Medians are drawn from point $A$ and point $B$ in this right triangle to divide segments $\overline{BC}$ and $\overline{AC}$ in half, respectively. The lengths of the medians are 6 and $2\sqrt{11}$ units, respectively. How many units are in the length of segment $\overline{AB}$?

[asy]
draw((0,0)--(7,0)--(0,4)--(0,0)--cycle,linewidth(2));
draw((0,1/2)--(1/2,1/2)--(1/2,0),linewidth(1));

label("$A$",(0,4),NW);
label("$B$",(7,0),E);
label("$C$",(0,0),SW);
[/asy]

Rationale:
We draw the medians as shown below.

[asy]
draw((0,0)--(7,0)--(0,4)--(0,0)--cycle,linewidth(2));
draw((0,1/2)--(1/2,1/2)--(1/2,0),linewidth(1));
draw((0,4)--(3.5,0));
draw((0,2)--(7,0));
label("$A$",(0,4),NW);
label("$B$",(7,0),E);
label("$C$",(0,0),SW);
label("$M$",(3.5,0),S);
label("$N$",(0,2),W);
[/asy]

From right triangles $ACM$ and $BCN$, we have \begin{align*}
AC^2 + CM^2 &= 36,\\
BC^2 + CN^2 &= (2\sqrt{11})^2 = 44.\end{align*}

However, we have $CM = BC/2$ and $CN = AC/2$, so the equations above become \begin{align*}
AC^2 + \frac14BC^2 &= 36,\\
BC^2 + \frac14AC^2 &=44.
\end{align*}

Adding these equations gives  \[\frac54(AC^2 + BC^2) = 80,\] so $AC^2 + BC^2 = 64$.  But the Pythagorean Theorem gives us $AB^2 = AC^2 + BC^2$, so $AB^2 = 64$, which means $AB = \boxed{8}$.

Problem:
In $\triangle PQR$, point $T$ is on side $QR$ such that $QT=6$ and $TR=10$. What is the ratio of the area of $\triangle PQT$ to the area of $\triangle PTR$? [asy]
size(6cm);
pair q = (0, 0); pair t = (6, 0); pair r = (16, 0);
pair p = (4, 8);
draw(p--q--r--cycle--t);
label("$P$", p, N);
label("$Q$", q, SW);
label("$T$", t, S);
label("$R$", r, SE);
label("$6$", midpoint(q--t), S, fontsize(10));
label("$10$", midpoint(t--r), S, fontsize(10));
[/asy] Write your answer in the form $x:y$, where $x$ and $y$ are relatively prime positive integers.

Rationale:
Construct the altitude of $\triangle PQT$ from $P$ to $QT$. Let the length of the altitude be $h$. [asy]
size(6cm);
pair q = (0, 0); pair t = (6, 0); pair r = (16, 0);
pair p = (4, 8); pair f = foot(p, q, r);
draw(p--q--r--cycle--t);draw(p--f, dashed);
label("$P$", p, N);
label("$Q$", q, SW);
label("$T$", t, S);
label("$R$", r, SE);
label("$6$", midpoint(q--t), S, fontsize(10));
label("$10$", midpoint(t--r), S, fontsize(10));
label("$h$", midpoint(p--f), W + S, fontsize(10));

markscalefactor = 0.07;
draw(rightanglemark(p, f, q));
[/asy] Note that this altitude of $\triangle PQT$ is also the altitude of $\triangle PTR$. The ratio of the area of $\triangle PQT$ to the area of $\triangle PTR$ is $$\frac{\frac{1}{2}\times QT\times h}{\frac{1}{2}\times TR\times h}=\frac{QT}{TR}=\frac{6}{10}=\frac{3}{5}.$$Therefore, our final answer is $\boxed{3:5}$.

We might try sketching a diagram: [asy]
pair pA, pB, pC, pI;
pA = (-1, 0);
pB = (0, 0);
pC = (0, 1);
pI = (-0.2929, 0.2929);
draw(pA--pB--pC--pA);
draw(pI--pB);
draw(circle(pI, 0.2929));
label("$A$", pA, SW);
label("$B$", pB, SE);
label("$C$", pC, NE);
label("$I$", pI, NE);
[/asy] Since $\triangle ABC$ is isosceles, we might try extending $BI$ to meet $AC$ at $D.$ That is advantageous to us since it will also be the perpendicular bisector and median to side $AC.$ In addition, let us draw a radius from $I$ that meets $AB$ at $E.$ [asy]
pair pA, pB, pC, pD, pE, pI;
pA = (-1, 0);
pB = (0, 0);
pC = (0, 1);
pD = (-0.5, 0.5);
pE = (-0.2929, 0);
pI = (-0.2929, 0.2929);
draw(pA--pB--pC--pA);
draw(pI--pB);
draw(pI--pD);
draw(pI--pE);
draw(circle(pI, 0.2929));
label("$A$", pA, SW);
label("$B$", pB, SE);
label("$C$", pC, NE);
label("$I$", pI, NE);
label("$D$", pD, NW);
label("$E$", pE, S);
[/asy] Given $r$ as the inradius, we can see that $DI = r$ and $IB = r\sqrt{2},$ since $\triangle IEB$ is also a little isosceles right triangle on its own. Therefore, $BD = r\sqrt{2} + r = r (\sqrt{2} + 1).$

However, we have a nice way of finding $BD,$ from $\triangle ABD,$ which is also an isosceles right triangle, thus $DB = \frac{AB}{\sqrt{2}} = \frac{4 \sqrt{2}}{\sqrt{2}} = 4.$

Setting the two expressions for $DB$ equal, we have: \begin{align*}
r(\sqrt{2} + 1) &= 4 \\
r &= \frac{4}{\sqrt{2} + 1} = \frac{4}{\sqrt{2} + 1} \cdot \frac{\sqrt{2} - 1}{\sqrt{2} - 1} \\
&= \frac{4(\sqrt{2} - 1)}{1} = 4\sqrt{2} - 4.
\end{align*} Our answer is $BI = r\sqrt{2} = (4\sqrt{2} - 4)\cdot \sqrt{2} = \boxed{8 - 4\sqrt{2}}.$

